import ErrorsSummery from "./ErrorsSummery";
import AvilableErrors from "./AvilableErrors";

const Errors = (props) => {
    return <>
        <ErrorsSummery/>
        <AvilableErrors addErrorHandler={props.addErrorHandler}/>
    </>
}

export default Errors;
